import React from "react";

function body() {
  return (
    <div id="thread-border">
      <div id="img-container">
        <img
          src="data:image/jpeg;base64,"
          alt=""
          srcset=""
        />
      </div>
      <div id="thread-container"></div>
    </div>
  );
}

export default body;
